// ---------- imports ----------
import { motion } from 'framer-motion';
import '../styles/Footer.css';

import WhatsAppLogo  from '../assets/whatsapp-logo.png';
import GmailLogo     from '../assets/gmail-logo.png';
import InstagramLogo from '../assets/instagram-logo.png';
import YouTubeLogo   from '../assets/youtube-logo.png';
import FacebookLogo  from '../assets/facebook-logo.png';
import TwitterLogo   from '../assets/twitter-logo.png';
import ThreadsLogo   from '../assets/threads-logo.png';

// ---------- constants ----------
const FOUNDER_DETAILS_URL = 'https://comeonsom.github.io/Big-Pocket.com/Other-files/founder.html';
const TERMS_PAGE_URL      = 'https://comeonsom.github.io/Big-Pocket.com/Other-files/terms.html';

// ---------- motion variants ----------
const fadeSlide = {
  hidden:  { opacity: 0, y: 40 },
  show:    { opacity: 1, y: 0, transition: { duration: 0.8, ease: [0.25, 0.1, 0.25, 1] } }
};

const Footer = () => {
  /* CTA handlers */
  const handleWhatsAppClick = () =>
    window.open('https://wa.me/917866049865', '_blank');

  const handleEmailClick = () =>
    window.open('https://mail.google.com/mail/?view=cm&fs=1&to=asversity.helpdesk@gmail.com', '_blank');

  /* render */
  return (
    <>
      {/* ---- Contact + Social container ---- */}
      <motion.div
        className="contact-container"
        variants={fadeSlide}
        initial="hidden"
        whileInView="show"
        viewport={{ once: true, amount: 0.3 }}
      >
        {/* ---- Contact section ---- */}
        <div className="contact-section">
          <h2>Contact Us</h2>
          <p>If you have any questions, feel free to reach out to us!</p>

          <div className="button-container">
            <motion.button
              whileHover={{ scale: 1.06 }}
              whileTap={{ scale: 0.96 }}
              onClick={handleWhatsAppClick}
              className="contact-whatsapp-button"
            >
              <img src={WhatsAppLogo} alt="WhatsApp" className="button-icon" />
              Send Message
            </motion.button>

            <motion.button
              whileHover={{ scale: 1.06 }}
              whileTap={{ scale: 0.96 }}
              onClick={handleEmailClick}
              className="contact-email-button"
            >
              <img src={GmailLogo} alt="Gmail" className="button-icon" />
              Send Email
            </motion.button>
          </div>
        </div>

        {/* ---- Social section ---- */}
        <div className="follow-us-section">
          <h3 className="follow-us-heading">Follow Us</h3>
          <div className="social-icons">
            {[  // map keeps markup tidy
              { href: 'https://www.instagram.com/asversity.insta/profilecard/?igsh=bXNiNGFjcXFwcnVq', img: InstagramLogo, alt: 'Instagram' },
              { href: 'https://youtube.com/@asversity_technologies?si=cGzrBWY0-kSOzmdP',                                          img: YouTubeLogo,    alt: 'YouTube'    },
              { href: 'https://www.facebook.com/asversityfacebook?mibextid=ZbWKwL',                                               img: FacebookLogo,   alt: 'Facebook'   },
              { href: 'https://x.com/Tcepsus_Vom?t=wbzoSwBzlryCJUYXVq9Eaw&s=09',                                                  img: TwitterLogo,    alt: 'Twitter/X'  },
              { href: 'https://www.threads.net/@asversity.insta?invite=0',                                                        img: ThreadsLogo,    alt: 'Threads'    },
            ].map(({ href, img, alt }) => (
              <motion.a
                key={alt}
                href={href}
                target="_blank"
                rel="noopener noreferrer"
                whileHover={{ y: -6, filter: 'brightness(1.2)' }}
              >
                <img src={img} alt={alt} />
              </motion.a>
            ))}
          </div>
        </div>
      </motion.div>

      {/* ---- Footer strip ---- */}
      <footer className="footer">
        <p>© {new Date().getFullYear()} ASCORP. All rights reserved.</p>

        <p>
          <motion.span
            className="clickable-text"
            onClick={() => window.open(FOUNDER_DETAILS_URL, '_blank')}
            whileHover={{ textShadow: '0px 0px 8px var(--highlight-color)', scale: 1.04 }}
          >
            Founder Details
          </motion.span>
          {' | '}
          <motion.span
            className="clickable-text"
            onClick={() => window.open(TERMS_PAGE_URL, '_blank')}
            whileHover={{ textShadow: '0px 0px 8px var(--highlight-color)', scale: 1.04 }}
          >
            Terms of Service
          </motion.span>
        </p>
      </footer>
    </>
  );
};

export default Footer;
